	'messages:blockedtext-partial' => 'hsb:<strong>Twoje wužiwarske konto abo twoja IP-adresa je za tutu akciju blokowane/blokowana. Snano móžeš hišće druhe wěcy w tutym wikiju wobdźěłać, kaž na př. wěste strony.</strong> Dospołne podrobnosće móžeš sej w swojich [[Special:MyContributions|wužiwarskich přinoškach]] wobhladać.

