	'messages:apihelp-main-extended-description' => 'de:<div class="hlist plainlinks api-main-links">
* [[mw:Special:MyLanguage/API:Main_page|Dokumentation]]
* [[mw:Special:MyLanguage/API:Etiquette|Etikette & Nutzungsrichtlinien]]
* [[mw:Special:MyLanguage/API:FAQ|Häufig gestellte Fragen]]
* [https://lists.wikimedia.org/postorius/lists/mediawiki-api.lists.wikimedia.org/ Mailingliste]
* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api-announce API-Ankündigungen]
* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R Fehlerberichte und Anfragen]
</div>
<strong>Status:</strong> Die MediaWiki-API ist eine ausgereifte und stabile Schnittstelle, die aktiv unterstützt und verbessert wird. Während wir versuchen, dies zu vermeiden, können wir gelegentlich Breaking Changes erforderlich machen. Abonniere die [https://lists.wikimedia.org/hyperkitty/list/mediawiki-api-announce@lists.wikimedia.org/ MediaWiki-API-Ankündigungs-Mailingliste] für Mitteilungen zu Aktualisierungen.

<strong>Fehlerhafte Anfragen:</strong> Wenn fehlerhafte Anfragen an die API gesendet werden, wird ein HTTP-Header mit dem Schlüssel „MediaWiki-API-Error“ gesendet. Der Wert des Headers und der Fehlercode werden auf den gleichen Wert gesetzt. Für weitere Informationen siehe [[mw:Special:MyLanguage/API:Errors_and_warnings|API: Fehler und Warnungen]].

<p class="mw-apisandbox-link"><strong>Testen:</strong> Zum einfachen Testen von API-Anfragen, siehe [[Special:ApiSandbox]].</p>',
	'messages:apihelp-main-param-action' => 'de:Auszuführende Aktion.',
	'messages:apihelp-main-param-maxlag' => 'de:maxlag kann verwendet werden, wenn MediaWiki auf einem datenbankreplizierten Cluster installiert ist. Um weitere Replikationsrückstände zu verhindern, lässt dieser Parameter den Client warten, bis der Replikationsrückstand kleiner als der angegebene Wert (in Sekunden) ist. Bei einem größerem Rückstand wird der Fehlercode <samp>maxlag</samp> zurückgegeben mit einer Nachricht wie <samp>Waiting for $host: $lag seconds lagged</samp>.<br />Siehe [[mw:Special:MyLanguage/Manual:Maxlag_parameter|Handbuch: Maxlag parameter]] für weitere Informationen.',
	'messages:apihelp-main-param-smaxage' => 'de:Den <code>s-maxage</code>-HTTP-Cache-Control-Header auf diese Anzahl Sekunden festlegen. Fehler werden niemals gepuffert.',
	'messages:apihelp-main-param-maxage' => 'de:Den <code>max-age</code>-HTTP-Cache-Control-Header auf diese Anzahl Sekunden festlegen. Fehler werden niemals gecacht.',
	'messages:apihelp-main-param-assert' => 'de:Sicherstellen, dass der Benutzer eingeloggt ist (eventuell auch als temporärer Benutzer), wenn <kbd>user</kbd> gesetzt, <em>nicht</em> angemeldet, wenn auf <kbd>anon</kbd> gesetzt, oder das Bot-Benutzerrecht hat, wenn auf <kbd>bot</kbd> gesetzt.',
	'messages:apihelp-main-param-assertuser' => 'de:Überprüft, ob der aktuelle Benutzer der benannte Benutzer ist.',
	'messages:apihelp-main-param-requestid' => 'de:Der angegebene Wert wird mit in die Antwort aufgenommen und kann zur Unterscheidung von Anfragen verwendet werden.',
	'messages:apihelp-main-param-servedby' => 'de:Namen des bearbeitenden Hosts mit zurückgeben.',
	'messages:apihelp-main-param-curtimestamp' => 'de:Aktuellen Zeitstempel mit zurückgeben.',
	'messages:apihelp-main-param-responselanginfo' => 'de:Bezieht die für <var>uselang</var> und <var>errorlang</var> verwendeten Sprachen im Ergebnis mit ein.',
	'messages:apihelp-main-param-origin' => 'de:Beim Zugriff auf die API mit einer Kreuz-Domain-AJAX-Anfrage (CORS) muss dies als entstehende Domäne festgelegt werden. Dies muss in jeder Vorfluganfrage mit eingeschlossen werden und deshalb ein Teil der Anfragen-URI sein (nicht des POST-Körpers).

Für authentifizierte Anfragen muss dies exakt einem der Ursprünge im Header <code>Origin</code> entsprechen, so dass es auf etwas wie <kbd>https://de.wikipedia.org</kbd> oder <kbd>https://meta.wikimedia.org</kbd> festgelegt werden muss. Falls dieser Parameter nicht mit dem Header <code>Origin</code> übereinstimmt, wird eine 403-Antwort zurückgegeben. Falls dieser Parameter mit dem Header <code>Origin</code> übereinstimmt und der Ursprung erlaubt ist, werden die Header <code>Access-Control-Allow-Origin</code> und <code>Access-Control-Allow-Credentials</code> festgelegt.

Gib für nicht authentifizierte Anfragen den Wert <kbd>*</kbd> an. Dies verursacht, dass der Header <code>Access-Control-Allow-Origin</code> festgelegt wird, aber <code>Access-Control-Allow-Credentials</code> wird <code>false</code> sein und alle benutzerspezifischen Daten werden beschränkt.',
	'messages:apihelp-main-param-crossorigin' => 'de:Wenn du mit einer domänenübergreifenden AJAX-Anfrage (CORS) auf die API zugreifst und einen Sitzungsanbieter verwendest, der gegen Cross-Site-Request-Forgery (CSRF)-Angriffe sicher ist (z. B. OAuth), verwende dies anstelle von <code>origin=*</code>, damit die Anfrage authentifiziert (d. h. nicht abgemeldet) ist. Dies muss in jeder Preflight-Anfrage enthalten sein und muss daher Teil der Anfrage-URI sein (nicht des POST-Bodys).

Beachte, dass die meisten Sitzungsanbieter, einschließlich Standard-Cookie-basierte Sitzungen, kein authentifiziertes CORS unterstützen und nicht mit diesem Parameter verwendet werden können.',
	'messages:apihelp-main-param-uselang' => 'de:Zu verwendende Sprache für Nachrichtenübersetzungen. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo&siprop=languages]]</kbd> gibt eine Liste der Sprachcodes zurück. Gib <kbd>user</kbd> zum Verwenden der aktuellen Benutzerspracheinstellung oder <kbd>content</kbd> an, um die Inhaltssprache des Wikis zu verwenden.',
	'messages:apihelp-main-param-variant' => 'de:Variante der Sprache. Funktioniert nur, wenn die Basissprache die Variantenkonvertierung unterstützt.',
	'messages:apihelp-main-param-errorformat' => 'de:Zu verwendendes Format zur Ausgabe von Warnungen und Fehlertexten',
	'messages:apihelp-main-paramvalue-errorformat-plaintext' => 'de:Wikitext mit entfernten HTML-Tags und ersetzten Entitäten.',
