	'messages:apihelp-main-paramvalue-errorformat-none' => 'de:Keine Textausgabe, nur die Fehlercodes.',
	'messages:apihelp-main-paramvalue-errorformat-bc' => 'de:Format, das vor MediaWiki 1.29 verwendet wurde. <var>errorlang</var> und <var>erroruselocal</var> werden ignoriert.',
	'messages:apihelp-main-param-errorlang' => 'de:Zu verwendende Sprache für Warnungen und Fehlermeldungen. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo&siprop=languages]]</kbd> mit <kbd>siprop=languages</kbd> gibt eine Liste von Sprachcodes zurück. Spezifiziere <kbd>content</kbd>, um die Inhaltssprache des Wikis zu verwenden, oder <kbd>uselang</kbd>, um denselben Wert wie der <var>uselang</var>-Parameter zu verwenden.',
	'messages:apihelp-main-param-errorsuselocal' => 'de:Falls angegeben, verwenden Fehlertexte lokalisierte Nachrichten aus dem {{ns:MediaWiki}}-Namensraum.',
	'messages:apihelp-acquiretempusername-summary' => 'de:Erfasst einen temporären Benutzernamen und speichert diesen in der aktuellen Sitzung, wenn die Erstellung von temporären Konten aktiviert und der aktuelle Benutzer abgemeldet ist. Wenn ein Name bereits gespeichert wurde, wird derselbe Name zurückgegeben.',
	'messages:apihelp-acquiretempusername-extended-description' => 'de:Wenn der Benutzer später eine Aktion durchführt, die zur Erstellung eines temporären Kontos führt, wird der vorher gespeicherte Benutzername für sein Konto verwendet. Er kann auch in Vorschauen verwendet werden. Das Konto ist jedoch noch nicht erstellt, und der Name ist für andere Benutzer nicht sichtbar.',
