	'messages:config-uploads-security-headers' => 'de:<strong>Warnung:</strong> Anfragen nach Bildern in deinem Hochlade-Verzeichnis sollten mit dem HTTP-Header <code>$1</code> beantwortet werden, um Browser vor potenziell unsicheren Dateien zu schützen.
