	'messages:config-upgrade-done' => 'de:Die Aktualisierung ist nun abgeschlossen.

Das Wiki kann nun [$1 genutzt werden].

Sofern die Datei <code>LocalSettings.php</code> neu erzeugt werden soll, bitte auf die Schaltfläche unten klicken.
Dies wird \'\'\'nicht empfohlen\'\'\', es sei denn, es treten Probleme mit dem Wiki auf.',
	'messages:config-mysql-engine-help' => 'de:<strong>InnoDB</strong> als Speichersubsystem für das Datenbanksystem MySQL ist fast immer die bessere Wahl, da es gleichzeitige Zugriffe gut unterstützt.

<strong>MyISAM</strong> als Speichersubsystem für das Datenbanksystem MySQL ist hingegen in Einzelnutzerumgebungen oder bei schreibgeschützten Wikis schneller.
Datenbanken, die MyISAM verwenden, sind indes tendenziell fehleranfälliger als solche, die InnoDB verwenden.',
	'messages:config-server' => 'de:URL-Hostname:',
	'messages:config-server-help' => 'de:Der Teil des Protokolls und des Hostnamens der URL, der für den Zugriff auf das Wiki verwendet wird. Der automatisch ermittelte Standard ist in der Regel korrekt.',
	'messages:config-project-namespace-help' => 'de:Dem Beispiel von Wikipedia folgend, unterscheiden viele Wikis zwischen den Seiten für Inhalte und denen für Richtlinien. Letztere werden im \'\'\'Projektnamensraum\'\'\' hinterlegt.
Alle Seiten dieses Namensraumes verfügen über ein Seitenpräfix, das nun an dieser Stelle angegeben werden kann.
Normalerweise steht dieses Seitenpräfix mit dem Namen des Wikis in einem engen Zusammenhang. Dabei können bestimmte Sonderzeichen wie „#“ oder „:“ nicht verwendet werden.',
	'messages:config-admin-error-password-invalid' => 'de:Ungültiges Administrator-Passwort für das Wiki: $1',
	'messages:config-subscribe-help' => 'de:Es handelt sich hierbei um eine Mailingliste mit wenigen Aussendungen, die für Mitteilungen zu Versionsveröffentlichungen, einschließlich wichtiger Sicherheitsveröffentlichungen, genutzt wird.
Diese Mailingliste sollte abonniert werden. Zudem sollte die MediaWiki-Installation stets aktualisiert werden, sobald eine neue Programmversion veröffentlicht wurde.',
	'messages:config-subscribe-noemail' => 'de:Beim Abonnieren der Mailingliste mit Mitteilungen zu Versionsveröffentlichungen wurde keine E-Mail-Adresse angegeben.
Bitte eine E-Mail-Adresse angeben, sofern die Mailingliste abonniert werden soll.',
	'messages:config-pingback' => 'de:Daten über diese Installation mit den MediaWiki-Entwicklern teilen. [https://foundation.wikimedia.org/wiki/MediaWiki_Pingback_Privacy_Statement Datenschutz].',
	'messages:config-pingback-help' => 'de:Sofern diese Option ausgewählt wird, meldet MediaWiki regelmäßig die Basisdaten dieser MediaWiki-Installation an https://www.mediawiki.org. Diese Daten enthalten beispielsweise den Betriebssystemtyp, die PHP-Version sowie das genutzte Datenbanksystem. Die Wikimedia Foundation teilt diese Daten mit den MediaWiki-Entwicklern, um Entscheidungen zur künftigen Softwareentwicklung zu verbessern. Die folgenden Daten werden für diese Installation gesendet:
<pre>$1</pre>

Die Datenschutzbestimmungen für diese Funktion können unter https://foundation.wikimedia.org/wiki/MediaWiki_Pingback_Privacy_Statement eingesehen werden.

Weitere allgemeine Informationen über diese Funktion findest du unter https://www.mediawiki.org/wiki/Special:MyLanguageManual:$wgPingback.

Für aggregierte Pingback-Daten siehe https://pingback.wmflabs.org.',
	'messages:config-profile-help' => 'de:Wikis sind am nützlichsten, wenn so viele Menschen wie möglich Bearbeitungen vornehmen können.
Mit MediaWiki ist es einfach, die letzten Änderungen nachzuvollziehen und unbrauchbare Bearbeitungen, beispielsweise von unbedarften oder böswilligen Benutzern, rückgängig zu machen.

Allerdings finden etliche Menschen Wikis auch mit anderen Bearbeitungskonzepten sinnvoll. Manchmal ist es zudem nicht einfach, alle Beteiligten von den Vorteilen des „Wiki-Prinzips” zu überzeugen. Darum ist diese Auswahl möglich.

Das Modell „\'\'\'{{int:config-profile-wiki}}\'\'\'“ ermöglicht es jedermann, sogar ohne über ein Benutzerkonto zu verfügen, Bearbeitungen vorzunehmen.
Ein Wiki bei dem die \'\'\'{{int:config-profile-no-anon}}\'\'\' ist, fordert von den Benutzern eine höhere Verantwortung für ihre Bearbeitungen ein, könnte allerdings Personen abschrecken, die nur gelegentlich Bearbeitungen vornehmen wollen. Ein Wiki für \'\'\'{{int:config-profile-fishbowl}}\'\'\' gestattet es nur bestimmten Benutzern, Bearbeitungen vorzunehmen. Allerdings kann dabei die Allgemeinheit die Seiten immer noch betrachten und Änderungen nachvollziehen. Ein \'\'\'{{int:config-profile-private}}\'\'\' gestattet es nur ausgewählten Benutzern, Seiten zu betrachten sowie zu bearbeiten.

Komplexere Konzepte zur Zugriffssteuerung können erst nach abgeschlossenem Installationsvorgang eingerichtet werden. Hierzu gibt es weitere Informationen auf der Website mit der [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:User_rights entsprechenden Anleitung].',
	'messages:config-license-help' => 'de:Viele öffentliche Wikis publizieren alle Beiträge unter einer [https://freedomdefined.org/Definition/De freien Lizenz.]
Dies trägt dazu bei, ein Gefühl von Gemeinschaft zu schaffen, und ermutigt zu längerfristiger Mitarbeit.
Hingegen ist im Allgemeinen eine freie Lizenz auf geschlossenen Wikis nicht notwendig.

Sofern man Texte aus der Wikipedia verwenden möchte und umgekehrt, sollte die Lizenz {{int:config-license-cc-by-sa}} gewählt werden.

Die Wikipedia nutzte vormals die GNU-Lizenz für freie Dokumentation (GFDL).
Die GFDL ist eine gültige Lizenz, die allerdings schwer zu verstehen ist.
Es ist zudem schwierig, gemäß dieser Lizenz lizenzierte Inhalte wiederzuverwenden.',
	'messages:config-email-auth-help' => 'de:Sofern diese Funktion aktiviert ist, müssen Benutzer ihre E-Mail-Adresse bestätigen, indem sie den Bestätigungslink nutzen, der ihnen immer dann zugesandt wird, wenn sie ihre E-Mail-Adresse angeben oder ändern.
Nur bestätigte E-Mail-Adressen können Nachrichten von anderen Benutzer oder Benachrichtigungsmitteilungen erhalten.
Die Aktivierung dieser Funktion wird bei offenen Wikis, mit Hinblick auf möglichen Missbrauch der E-Mail-Funktionen, \'\'\'empfohlen.\'\'\'',
	'messages:config-email-sender-help' => 'de:Bitte hier die E-Mail-Adresse angeben, die als Absenderadresse bei ausgehenden E-Mails eingesetzt werden soll.
Rücklaufende E-Mails werden an diese E-Mail-Adresse gesandt.
Bei vielen E-Mail-Servern muss der Teil der E-Mail-Adresse mit der Domainangabe korrekt sein.',
	'messages:config-upload-help' => 'de:Das Hochladen von Dateien macht den Server für potentielle Sicherheitsprobleme anfällig.
Weitere Informationen hierzu können im [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Security Abschnitt Sicherheit] der Anleitung nachgelesen werden.

Um das Hochladen von Dateien zu ermöglichen, muss der Zugriff auf das Unterverzeichnis <code>./images</code> so geändert werden, dass dieses für den Webserver beschreibbar ist.
Hernach kann diese Option aktiviert werden.',
