	'messages:config-logo-summary' => 'de:Für jedes dieser Felder musst du ein Bild in der entsprechenden Größe hochladen und die URL in die unten stehenden Felder eingeben. Du kannst  <code>$wgStylePath</code> oder <code>$wgScriptPath</code> verwenden, wenn dein Logo relativ zu diesen Pfaden abgelegt ist. Du kannst jedes dieser Felder leer lassen.',
