	'messages:config-logo-sidebar-help' => 'de:Einige MediaWiki-Skins enthalten ein Logo mit 160 Pixel Höhe als Teil des Seitenleistenmenüs. Wenn es nicht definiert ist, ist es dasselbe wie das oben definierte Symbol. Vielleicht möchtest du eine eigene Grafik haben, die Wortmarke und Icon kombiniert.',
	'messages:config-instantcommons-help' => 'de:[https://www.mediawiki.org/wiki/Special:MyLanguage/InstantCommons InstantCommons] ist eine Funktion, die es Wikis ermöglicht, Bild-, Klang- und andere Mediendateien zu nutzen, die auf der Website [https://commons.wikimedia.org/ Wikimedia Commons] verfügbar sind.
Um diese Funktion nutzen zu können, muss das Wiki über eine Verbindung zum Internet verfügen.

Weitere Informationen zu dieser Funktion, einschließlich der Anleitung, wie hierfür andere Wikis als Wikimedia Commons eingerichtet werden können, gibt es im [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:$wgForeignFileRepos Handbuch].',
	'messages:config-cache-help' => 'de:Das Objektcaching wird dazu genutzt, die Geschwindigkeit von MediaWiki zu verbessern, indem häufig genutzte Daten zwischengespeichert werden.
