	'messages:managewiki-header-core' => 'de:Hier kannst du die Grundeinstellungen dieses Wikis (z. B. den Namen und die Sprache) festlegen. Ausgegraute Optionen können nur von den Betreibern der Farm geändert werden. Wenn du das getan hast, klicke auf „Speichern“ und deine Einstellungen werden in wenigen Sekunden übernommen.

