	'messages:apihelp-undelete-extended-description' => 'en:A list of deleted revisions (including timestamps) can be retrieved through [[Special:ApiHelp/query+deletedrevisions|prop=deletedrevisions]], and a list of deleted file IDs can be retrieved through [[Special:ApiHelp/query+filearchive|list=filearchive]].',
	'messages:apihelp-undelete-param-timestamps' => 'en:Timestamps of the revisions to undelete. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be undeleted.',
	'messages:apihelp-undelete-param-fileids' => 'en:IDs of the file revisions to restore. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be restored.',
	'messages:apihelp-undelete-param-watchlist' => 'en:Unconditionally add or remove the page from the current user\'s watchlist, use preferences (ignored for bot users) or do not change watch.',
