	'messages:apihelp-upload-summary' => 'en:Upload a file, or get the status of pending uploads.',
	'messages:apihelp-upload-extended-description' => 'en:Several methods are available:
* Upload file contents directly, using the <var>$1file</var> parameter.
* Upload the file in pieces, using the <var>$1filesize</var>, <var>$1chunk</var>, and <var>$1offset</var> parameters.
* Have the MediaWiki server fetch a file from a URL, using the <var>$1url</var> parameter.
* Complete an earlier upload that failed due to warnings, using the <var>$1filekey</var> parameter.
Note that the HTTP POST must be done as a file upload (i.e. using <code>multipart/form-data</code>) when sending the <var>$1file</var>.',
	'messages:apihelp-upload-param-comment' => 'en:Upload comment. Also used as the initial page text for new files if <var>$1text</var> is not specified.',
	'messages:apihelp-upload-param-watchlist' => 'en:Unconditionally add or remove the page from the current user\'s watchlist, use preferences (ignored for bot users) or do not change watch.',
	'messages:apihelp-upload-param-watchlistexpiry' => 'en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.',
	'messages:apihelp-upload-param-filekey' => 'en:Key that identifies a previous upload that was stashed temporarily.',
	'messages:apihelp-upload-param-sessionkey' => 'en:Same as $1filekey, maintained for backward compatibility.',
	'messages:apihelp-upload-param-stash' => 'en:If set, the server will stash the file temporarily instead of adding it to the repository.',
	'messages:apihelp-upload-param-offset' => 'en:Offset of chunk in bytes.',
	'messages:apihelp-upload-param-chunk' => 'en:Chunk contents.',
	'messages:apihelp-upload-param-async' => 'en:Make potentially large file operations asynchronous when possible.',
	'messages:apihelp-userrights-param-expiry' => 'en:Expiry timestamps. May be relative (e.g. <kbd>5 months</kbd> or <kbd>2 weeks</kbd>) or absolute (e.g. <kbd>2014-09-18T12:34:56Z</kbd>). If only one timestamp is set, it will be used for all groups passed to the <var>$1add</var> parameter. Use <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd>, or <kbd>never</kbd> for a never-expiring user group.',
	'messages:apihelp-userrights-param-watchlistexpiry' => 'en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.',
	'messages:apihelp-userrights-example-user' => 'en:Add user <kbd>FooBot</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.',
	'messages:apihelp-userrights-example-userid' => 'en:Add the user with ID <kbd>123</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.',
	'messages:apihelp-userrights-example-expiry' => 'en:Add user <kbd>SometimeSysop</kbd> to group <kbd>sysop</kbd> for 1 month.',
	'messages:apihelp-watch-summary' => 'en:Add or remove pages from the current user\'s watchlist.',
	'messages:apihelp-watch-param-title' => 'en:The page to (un)watch. Use <var>$1titles</var> instead.',
	'messages:apihelp-watch-param-expiry' => 'en:Expiry timestamp to be applied to all given pages. Omit this parameter entirely to leave any current expiries unchanged.',
	'messages:apihelp-watch-param-unwatch' => 'en:If set the page will be unwatched rather than watched.',
