	'messages:apihelp-json-param-ascii' => 'en:If specified, encodes all non-ASCII using hexadecimal escape sequences. Default when <var>formatversion</var> is <kbd>1</kbd>.',
	'messages:api-format-prettyprint-header-only-html' => 'en:This is an HTML representation intended for debugging, and is unsuitable for application use.

See the [[mw:Special:MyLanguage/API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.',
	'messages:api-format-prettyprint-header-hyperlinked' => 'en:This is the HTML representation of the $1 format. HTML is good for debugging, but is unsuitable for application use.

Specify the <var>format</var> parameter to change the output format. To see the non-HTML representation of the $1 format, set [$3 <kbd>format=$2</kbd>].

See the [[mw:API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.',
	'messages:api-login-fail-aborted' => 'en:Authentication requires user interaction, which is not supported by <kbd>action=login</kbd>. To be able to login with <kbd>action=login</kbd>, see [[Special:BotPasswords]]. To continue using main-account login, see <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.',
	'messages:api-login-fail-aborted-nobotpw' => 'en:Authentication requires user interaction, which is not supported by <kbd>action=login</kbd>. To log in, see <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.',
